const mongoose = require("mongoose");

const ProfileSchema = new mongoose.Schema({
  name: {
    type: String,
    required: [true, "Please add name"],
    maxlength: 20,
  },
  about: {
    type: String,
    default: null,
    maxlength: 1000,
  },
  profession: {
    type: String,
    default: null,
  },
  position: {
    type: String,
    default: null,
  },
  location: {
    type: String,
    default: null,
  },
  skills: {
    type: String,
    default: null,
    maxlength: 500,
  },
  languages: { type: String, default: null },
  photo: {
    type: String,
    default:
      "",
  },
  createdAt: {
    type: Date,
    default: Date.now,
  },
  user: {
    type: mongoose.Schema.ObjectId,
    ref: "User",
    required: true,
  },
});

module.exports = mongoose.model("Profile", ProfileSchema);
